package exercise.week09.LC389;

/**
 * @description: 389.找不同
 * @author: Daniel Deen
 * @create: 2020-12-18 01:18
 */

public class LC389S1 {

    public static void main(String[] args) {


        String s = "";
        String t = "";
        char res = new LC389S1().findTheDifference(s, t);
        System.out.println(res);
    }

    public char findTheDifference(String s, String t) {
        int[] temp = new int[26];
        for (int i = 0; i < s.length(); i++) {
            temp[s.charAt(i) - 'a']++;
            temp[t.charAt(i) - 'a']--;
        }

        for (int i = 0; i < 26; i++) {
            if (temp[i] == -1) return (char)(i + 'a');
        }
        return t.charAt(s.length());
    }
}
